import styles from './styles/sideMenu.module.css'

function SideMenu ({menuClick, changeMenuClicked}) {
    return (
        <div className={`${menuClick ? "fixed transform -left-0 transition-all ease-out duration-500": "absolute -translate-y-24"} z-20 h-full w-11/12 bg-white`}
            onClick={changeMenuClicked}
        >
            {console.log("menu : ", menuClick ? "clicked ": "not clicked ")}
            <h1>Side Menu</h1>
        </div>
    )
}

export default SideMenu
